import Link from 'next/link';
import './index.css'

const LandingPage = () => (
    <div className="background">
        <Link href="/dealer">
            <a>Dealer</a>
        </Link>
        <Link href="/customer">
            <a>Customer</a>
        </Link>
    </div>
);

export default LandingPage;
